                <div className=''>
                <form id="contForm">
                    
                        <label>Nome: </label><br />
                        <input class="input" type="text" /><br />

                        <label>E-mail: </label><br />
                        <input class="input" type="email" /><br />

                        <label>Mensagem: </label><br />
                        <textarea name="msg" id="msg"></textarea><br />

                        <input id="btn-enviar" type="submit" value="Enviar" />

                    </form>
            </div>
        </>
    );
}
